openapi: 3.1.0
info:
  title: NVIDIA INFERENCE SERVICE API for nvidia/nvclip-vit-h-14
  description: NVIDIA INFERENCE SERVICE API
  version: 1.0.0
  termsOfService: https://nvidia.com/legal/terms-of-use
  contact:
    name: NVIDIA Support
    url: https://help.nvidia.com/
  license:
    name: NVIDIA AI Foundation Models Community License
    url: https://docs.nvidia.com/ai-foundation-models-community-license.pdf
tags:
  - name: "NVIDIA NVCLIP API"
    description: Get a vector representation of a given input that can be easily consumed by machine learning models and algorithms.
paths:
  "/v1/embeddings":
    post:
      tags:
        - Embeddings
      summary: Creates an embedding vector representing the input text or image.
      description: "Invokes inference using the embedding parameters. If uploading
        large images, this POST should be used in conjunction with the NVCF API which
        allows for the upload of large assets. \nYou can find details on how to use
        NVCF Asset APIs here: https://docs.api.nvidia.com/cloud-functions/reference/createasset."
      operationId: create_embedding
      requestBody:
        content:
          application/json:
            schema:
              "$ref": "#/components/schemas/EmbeddingsRequest"
        required: true
      x-nvai-meta:
        name: "Create Text Embedding"
        description: |
          Generates an embedding vector from the provided text
          using a specified model. The embedding can be returned
          in either float array or base64-encoded format.
        path: "create"
        templates:
          - title: "Synchronous requests"
            requestEjs:
              curl: |
                curl -X POST https://integrate.api.nvidia.com/v1/embeddings \
                  -H "Content-Type: application/json" \
                  -H "Authorization: Bearer $NVIDIA_API_KEY" \
                  -d '{
                    "input": ["Image of a dog",
                              "data:image/jpeg;base64,"],
                    "model": "nvidia/nvclip-vit-h-14",
                    "encoding_format": "float"
                  }'
              python: |
                from openai import OpenAI

                client = OpenAI(
                  api_key="$NVIDIA_API_KEY",
                  base_url="https://integrate.api.nvidia.com/v1"
                )

                response = client.embeddings.create(
                    input=[ "Image of a dog",
                            "data:image/jpeg;base64,"],
                    model="nvidia/nvclip-vit-h-14",
                    encoding_format="float"
                )

                print(response.data[0].embedding)
              node: |
                import OpenAI from 'openai';

                const openai = new OpenAI({
                  apiKey: '$NVIDIA_API_KEY',
                  baseURL: 'https://integrate.api.nvidia.com/v1/',
                })

                async function main() {
                  const response = await openai.embeddings.create({
                    input: ["The quick brown fox jumped over the lazy dog",
                    "data:image/jpeg;base64,"
                  ],
                    model: "nvidia/nvclip-vit-h-14",
                    encoding_format: "float"
                  })

                  const embedding = response.data[0].embedding;
                  process.stdout.write(`${embedding}\n`);
                }

                main();

