            pattern: ^.*$
          - type: array
            items:
              type: string
              pattern: ^.*$
            maxItems: 64
          title: Input
          description: 'The list of images or texts that you want to generate embeddings
            for. Images should be in form of `data:image/{format};base64,{base64encodedimage}`.
            If the size of an image is more than 200KB, it needs to be uploaded to
            a presigned S3 bucket using NVCF Asset APIs. Once uploaded you can refer
            to it using the following format: `<img src="data:image/png;asset_id,{asset_id}"
            />`. Accepted formats are `jpg`, `png` and `jpeg`.'
          examples:
          - - The quick brown fox jumped over the lazy dog
            - data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAIAAACQd1PeAAAAEElEQVR4nGK6HcwNCAAA//8DTgE8HuxwEQAAAABJRU5ErkJggg==
          - - The quick brown fox jumped over the lazy dog
            - data:image/png;asset_id,87b132b0-08f9-43ea-8fab-f107350a5d00
