            "$ref": "#/components/schemas/Embedding"
          type: array
          title: Data
          description: The list of embeddings generated by the model.
          maxItems: 128
          examples:
          - - embedding:
              - 0.1
              - 0.1
              - 0.1
              index: 0
              object: embedding
            - embedding:
              - 0.1
              - 0.1
              - 0.1
              index: 1
